// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract DonorStructure {
    struct Donor {
        address donorPublicAddress;
        string name;
        uint256 age;//added
        string gender;//added
        string bloodType;
        string phoneNumber;
        string password;
        uint256 donatedVolume;
        uint256 totalPayment;
        bool isRegistered;
        bool isLogin;
        uint256[] donorTransactionHistory;
    }

    mapping(address => Donor) public donors;

    address[] public donorAddressArr;
}
